function changeLandingImage() {
    windowHeight = $(window).height();
    windowWidth = $(window).width();

    //large Screens
    if (windowWidth > grid_breakpoints['lg'])
        landingContainer.append(largeScreen);
    //Small Screens
    else
        landingContainer.append(smallScreen);

    //Move the landing image up so it is positioned correctly on the screen
    if (windowWidth > grid_breakpoints['lg'])
        landingContainerMain.css('top', windowHeight * -1 / 6);
    else if (windowWidth <= grid_breakpoints['lg'] && windowWidth > grid_breakpoints['md'])
        landingContainerMain.css('top', windowHeight * -1 / 3);
    else if (windowWidth <= grid_breakpoints['md'] && windowWidth > grid_breakpoints['sm'])
        landingContainerMain.css('top', windowHeight * -1 / 3);
    else if (windowWidth <= grid_breakpoints['sm'])
        landingContainerMain.css('top', windowHeight * -1 / 4);
}



